import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AddTransaction = () => {
  const [customers, setCustomers] = useState([]);
  const [customer_id, setCustomerId] = useState('');
  const [amount, setAmount] = useState('');
  const [description, setDescription] = useState('');
  const [type, setType] = useState('credit');

  // Local menu list state
  const [menuList, setMenuList] = useState(['Tea', 'Coffee', 'Snacks']);
  const [newMenuItem, setNewMenuItem] = useState('');

  useEffect(() => {
    fetchCustomers();
  }, []);

  const fetchCustomers = async () => {
    const res = await axios.get('http://localhost:3010/customers');
    setCustomers(res.data);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:3010/addTransaction', { customer_id, amount, description, type });
      alert('Transaction added');
      setAmount('');
      setDescription('');
    } catch (err) {
      console.error(err);
      alert('Error adding transaction');
    }
  };

  const addMenuItem = () => {
    if (newMenuItem.trim() && !menuList.includes(newMenuItem)) {
      setMenuList([...menuList, newMenuItem]);
      setNewMenuItem('');
    }
  };

  const deleteMenuItem = (item) => {
    setMenuList(menuList.filter(m => m !== item));
    if (description === item) setDescription('');
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-green-100 via-blue-100 to-purple-200 p-4">
      <div className="bg-white rounded-xl shadow-lg p-6 w-full max-w-md">
        <h3 className="text-2xl font-bold mb-4 text-center text-gray-700">Add Transaction</h3>

        <form onSubmit={handleSubmit} className="space-y-4">
          <select
            value={customer_id}
            onChange={(e) => setCustomerId(e.target.value)}
            required
            className="w-full border px-3 py-2 rounded"
          >
            <option value="">Select Customer</option>
            {customers.map(cust => (
              <option key={cust.id} value={cust.id}>{cust.name}</option>
            ))}
          </select>

          <input
            type="number"
            value={amount}
            placeholder="Amount"
            onChange={(e) => setAmount(e.target.value)}
            required
            className="w-full border px-3 py-2 rounded"
          />

          {/* Description dropdown with add/delete functionality */}
          <div className="space-y-2">
            <select
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              required
              className="w-full border px-3 py-2 rounded"
            >
              <option value="">Select Menu Item</option>
              {menuList.map((item, index) => (
                <option key={index} value={item}>{item}</option>
              ))}
            </select>

            <div className="flex space-x-2">
              <input
                type="text"
                placeholder="Add Menu Item"
                value={newMenuItem}
                onChange={(e) => setNewMenuItem(e.target.value)}
                className="flex-1 border px-3 py-2 rounded"
              />
              <button
                type="button"
                onClick={addMenuItem}
                className="bg-green-600 text-white px-4 py-2 rounded"
              >
                Add
              </button>
            </div>

            <div className="flex flex-wrap gap-2 mt-2">
              {menuList.map((item, index) => (
                <div key={index} className="bg-gray-200 px-2 py-1 rounded flex items-center space-x-1">
                  <span>{item}</span>
                  <button
                    type="button"
                    onClick={() => deleteMenuItem(item)}
                    className="text-red-600 font-bold"
                  >
                    ×
                  </button>
                </div>
              ))}
            </div>
          </div>

          <select
            value={type}
            onChange={(e) => setType(e.target.value)}
            required
            className="w-full border px-3 py-2 rounded"
          >
            <option value="credit">Credit</option>
            <option value="debit">Debit</option>
          </select>

          <button
            type="submit"
            className="w-full bg-purple-600 text-white px-4 py-2 rounded font-semibold hover:bg-purple-700 transition"
          >
            Add Transaction
          </button>
        </form>
      </div>
    </div>
  );
};

export default AddTransaction;
